import './App.css';

function App() {
  const handleKeyPress = e => {
    console.log("key pressed");
    console.log(e.keyCode);
    if (e.keyCode === 13) {
      console.log("enter key pressed");
    }
  }

  return (
    <div className="App">
      <body>
        <input
          class="answer"
          onKeyPress={handleKeyPress}
        />
      </body>
    </div>
  );
}

export default App;
